import classes from "./Quiz.module.css";

function submitQuiz() {
  <div>{console.log("submit quiz")}</div>;
}
// on submit, show results
//submitButton.addEventListener("click", submitQuiz);
//test
export default function QuizPage() {

  //get event value
  const getInputValue = (event)=>{
    const userValue = event.target.value;

    console.log(userValue);
  }

  return (
    <div id="quiz">
      <li>
        <ul>What color would you like your wine?</ul>
        <ul>
          <input type="checkbox" id="redWine" onChange={getInputValue}   />
          <label for="redWine"> Red</label><br />
          <input type="checkbox" id="whiteWine" onChange={getInputValue} />
          <label for="whiteWine"> White</label>
        </ul>
        <ul>How expensive?</ul>
        <ul><input type="range" id="priceScale" onChange={getInputValue}  /></ul>
        <ul>How sweet?</ul>
        <ul><input type="range" id="sweetScale" onChange={getInputValue}  /></ul>
        <ul>What Year?</ul>
        <ul><input type="range" id="yearScale" onChange={getInputValue}  /></ul>
        <ul>Region? (cuntry)</ul>
      </li>
      <button id="submit" onClick={submitQuiz()}>
        Submit
      </button>
      <p>
        Value: <span id="demo"></span>
      </p>
    </div>
  );
}
